import React, { useContext } from 'react';
import { ThemeContext } from '../Contexts';
import Main from '../components/Main';


function Home() {
  const { query } = useContext(ThemeContext);

  return (
    <div style={{ backgroundColor: '#6546' }}>
      <Main term={query} />
    </div>
  );
}

export default Home;
